import React, {useContext, useEffect, useRef} from "react";
import {getBookById, updateBookById} from "../services/ApiService";
import {NavLink, useNavigate, useParams} from 'react-router-dom';
import {BookContext} from "../context/BookContext";

export default function UpdateBookForm() {

  const { id } = useParams();
  const navigate = useNavigate();
  const {book, updateBook} = useContext(BookContext);

  async function update(target) {
    target.preventDefault();

    try {
      const response = await updateBookById(id, book);
      navigate(`/${response.id}`);
    } catch (error) {
      console.error('Error', error);
    }
  }

  useEffect(() => {

    async function fetchData() {
      try {
        const book = await getBookById(id);
        updateBook(book);
      } catch (error) {
        console.error('Error fetching Books:', error);
      }
    }

    fetchData();
  }, []);

  const handleChange = (event) => {
    const { id, value } = event.target;

    switch (id) {
      case "title":
        updateBook({...book, title: value});
        break;
      case "author":
        updateBook({...book, author: value});
        break;
      case "genre":
        updateBook({...book, genre: value});
        break;
      case "summary":
        updateBook({...book, summary: value});
        break;
      default:
        break;
    }
  };

  return(
    <div>
      <nav aria-label="breadcrumb">
        <ol className="breadcrumb">
          <li className="breadcrumb-item">
            <NavLink to="/">Books</NavLink>
          </li>
          <li className="breadcrumb-item">
            <NavLink active to={`/${id}`}>{id}</NavLink>
          </li>
          <li className="breadcrumb-item active">
            <NavLink active to={`/${id}/edit`}>edit</NavLink>
          </li>
        </ol>
      </nav>
      <form>
        <div className="mb-3 mt-5">
          <label htmlFor="title" className="form-label">Title</label>
          <input onChange={handleChange} value={book.title} type="text" className="form-control" id="title" aria-describedby="titleHelp" />
          <div id="titleHelp" className="form-text">Input the Book title here.</div>
        </div>
        <div className="mb-3">

          <div className="row">
            <div className="col-6">
              <label htmlFor="author" className="form-label">Price</label>
              <input onChange={handleChange} value={book.author} type="text" className="form-control" id="author" />
            </div>
            <div className="col-6">
              <label htmlFor="genre" className="form-label">Quantity</label>
              <input onChange={handleChange} value={book.genre} type="text" className="form-control" id="genre" />
            </div>
            <div className="col-6">
              <label htmlFor="summary" className="form-label">Quantity</label>
              <input onChange={handleChange} value={book.summary} type="text" className="form-control" id="summary" />
            </div>
          </div>

        </div>
        <button onClick={update} type="submit" className="btn btn-primary">Update</button>
      </form>
    </div>
  );

}
